import { Image, ScrollView, StyleSheet, Text, View } from 'react-native'
import React from 'react'

export default function ContactList() {
    const contacts = [{
        id: 1,
        name: "John",
        number: "+923550029485",
        status: "I <3 coding",
        img: "data:image/jpeg;base64,"
    }, {
        id: 2,
        name: "Smith",
        number: "+923550029485",
        status: "I <3 coding",
        img: "data:image/jpeg;base64,"
    }, {
        id: 3,
        name: "David",
        number: "+923550029485",
        status: "I <3 coding",
        img: "data:image/jpeg;base64,"
    }, {
        id: 4,
        name: "Finch",
        number: "+923550029485",
        status: "I <3 coding",
        img: "data:image/jpeg;base64,"
    }]

    return (
        <View>
            <Text style={styles.headingText}>ContactList</Text>
            <ScrollView
                style={styles.container}
                scrollEnabled={false}
            >
                {
                    contacts.map((item) => {
                        return (
                            <View
                                key={item.id}
                                style={styles.userCard}
                            >
                                <Image
                                    source={{
                                        uri: item.img
                                    }}
                                    style={styles.userImg}
                                />
                                <View>
                                    <Text style={styles.userName}>{item.name}</Text>
                                    <Text style={styles.userStatus}>{item.status}</Text>
                                </View>
                            </View>
                        )
                    })
                }
            </ScrollView >
        </View >
    )
}

const styles = StyleSheet.create({
    headingText: {
        fontSize: 24,
        fontWeight: 'bold',
        paddingHorizontal: 8
    },
    container: {
        paddingHorizontal: 16,
        marginBottom: 4
    },
    userCard: {
        flex: 1,
        flexDirection: 'row',
        alignItems: 'center',
        marginBottom: 3,
        backgroundColor: 'purple',
        padding: 8,
        borderRadius: 10
    },
    userImg: {
        width: 60,
        height: 60,
        borderRadius: 50,
        marginRight: 14
    },
    userName: {
        fontSize: 16,
        fontWeight: '600',
    },
    userStatus: {
        fontSize: 12,
    }
})